import React from 'react'
import {Component} from 'react'

class Search extends Component {
    state = {
        search: ''
    }

    handleChange = (e) => {
        this.setState({
            search: e.target.value
        })

    }


    render(){
        return(
            <div>
                <form>
                    <h1 className="center"> Search & Chill</h1>
                    <input type="text" onChange={this.handleChange}/>
                </form>
            </div>

        )
    }

}

export default Search;
